const initState= {
    data: [{palabra:'hola'}]
}

const rootReducer = (state=initState, action) =>{
    if (action.type === 'CREATE_DATA') {
        return {
            ...state,
            data: action.data
        }
    }
    return state;
}


export default rootReducer;
